import React, { Component } from 'react'
import { createBrowserHistory } from 'history'

const history = createBrowserHistory()
const id = history.location.state.id
class aluno extends Component {
  state = {
    id: null
  }

  componentDidMount() {
    this.setState({
      id: id
    })



  }

  render() {
    return (
      <div>
        <h1>Aluno</h1>
      </div>
    )
  }
}

export default aluno
